    false,nt"url": null,nt"notes": "This document is the completed effort of
    the U.S. Fish and Wildlife Service, Wilderness Fellows program to develop a monitoring
    strategy and evaluate the status of the Prosposed Assateague Wilderness of Chincoteague
    National Wildlife Refuge, The Assateague Island National Seashore, and the Assateague
    State Park. The central 6,500 acres of Assateague Island was proposed aswilderness
    in 1974, but has yet to receive designation. Until such a Congressional decision
    is made, ASIS and CNWR manage the area to preserve its wilderness character. An
    evaluation of the current land status will set a 2012 baseline for wilderness character
    and support a plan for monitoring long-term trends. An interagency team, representing
    the U.S. Fish & Wildlife Service (USFWS), National Park Service (NPS), U.S. Forest
    Service (USFS), and Bureau of Land Management (BLM), developed a guide for wilderness
    character monitoring. 33 measures were used for the wilderness character monitoring
